  return (
    <div>
      <Typography
        className={classes.title}
        gutterBottom
        variant="h5"
        component="h2"
      >
        {post.title}
      </Typography>
      <Typography variant="body2" color="textSecondary" component="p">
        {post.message}
      </Typography>
    </div>
  );
}

export default ViewPost;
